def remove_Occ(s, ch):
    first_occ = False
    last_occ = False
    for i in range(len(s)):
        if s[i] == ch and not first_occ:
            s = s[:i] + s[i+1:]
            first_occ = True
            break
    for i in range(len(s) - 1, -1, -1):
        if s[i] == ch and not last_occ:
            s = s[:i] + s[i+1:]
            last_occ = True
            break
    return s

def roman_to_int(s):
    rom_val = {'I': 1, 'V': 5, 'X': 10, 'L': 50, 'C': 100, 'D': 500, 'M': 1000}
    int_val = 0
    for i in range(len(s)):
        if i > 0 and rom_val[s[i]] > rom_val[s[i - 1]]:
            int_val += rom_val[s[i]] - 2 * rom_val[s[i - 1]]
        else:
            int_val += rom_val[s[i]]
    return int_val

