import math 

def max_Prime_Factors(n): 
    maxPrime = -1 
    while n % 2 == 0: 
        maxPrime = 2
        n >>= 1    
    for i in range(3, int(math.sqrt(n)) + 1, 2): 
        while n % i == 0: 
            maxPrime = i 
            n /= i 
    if n > 2: 
        maxPrime = n  
    return int(maxPrime)

def find_missing(ar, N):
    l = 0
    r = N - 1
    while l <= r:
        mid = (l + r) // 2
        if mid + 1 != ar[mid] and (mid == 0 or mid + 1 == ar[mid - 1] + 1):
            return mid + 1
        elif ar[mid] != mid + 1:
            r = mid - 1
        else:
            l = mid + 1
    return -1

