def min_coins(coins, m, V):
    dp = [sys.maxsize] * (V + 1)
    dp[0] = 0

    for i in range(1, V + 1):
        for j in range(m):
            if coins[j] <= i:
                sub_res = dp[i - coins[j]]
                if sub_res != sys.maxsize and sub_res + 1 < dp[i]:
                    dp[i] = sub_res + 1

    return dp[V]

