    i, j, d = 0, 0, 0
    while i < m and j < n:
        if k == 1: return min(arr1[i], arr2[j])
        mid = k // 2
        ni = min(mid, m-i)
        nj = min(mid, n-j)
        if arr1[i + ni - 1] < arr2[j + nj - 1]:
            i += ni
            k -= ni
        else:
            j += nj
            k -= nj

    if i < m:
        return arr1[i + k - 1]
    return arr2[j + k - 1]

