def sum_Of_Primes(n): 
    prime = [True] * (n + 1)  
    p = 2
    while p * p <= n: 
        if prime[p] == True:  
            i = p * p
            while i <= n: 
                prime[i] = False
                i += p 
        p += 1    
    total_sum = 0
