def find_first_occurrence(A, x):
    (left, right) = (0, len(A) - 1)
    result = -1
    while left <= right:
        mid = (left + right) // 2
        if x == A[mid]:
            result = mid
            right = mid - 1
        elif x < A[mid]:
            right = mid - 1
        else:
            left = mid + 1
    return result

def set_middle_bits(n):  
    n |= n >> 1
    n |= n >> 2
    n |= n >> 4
    n |= n >> 8
    n |= n >> 16
    n = (n >> 1) ^ 1
    return n

def toggle_middle_bits(n): 
    if n == 1: 
        return 1
    mask = set_middle_bits(n)
    for i in range(n.bit_length()):
        if i == 0 or i == n.bit_length() - 1:
            mask &= ~(1 << i)
    return n ^ mask

