def find_triplet_array(A, arr_size, sum):
    for i in range(0, arr_size-2):
        for j in range(i + 1, arr_size-1):
            for k in range(j + 1, arr_size):
                if A[i] + A[j] + A[k] == sum:
                    return A[i], A[j], A[k]
    return None

