def max_product(arr):
    arr_len = len(arr)
    if arr_len < 2:
        return None

    x = arr[0]
    y = arr[1]

    for i in range(arr_len):
        for j in range(i + 1, arr_len):
            if arr[i] * arr[j] > x * y:
                x = arr[i]
                y = arr[j]

    return x, y

def super_seq(X, Y, m, n):
    if m == 0:
        return n
    if n == 0:
        return m
    if X[m - 1] == Y[n - 1]:
        return 1 + super_seq(X, Y, m - 1, n - 1)
    return 1 + min(super_seq(X, Y, m - 1, n), super_seq(X, Y, m, n - 1))

