def maximum_segments(n, a, b, c):
	dp = [-1] * (n + 1)
	dp[0] = 0
	for i in range(n + 1):
		if dp[i] != -1:
			if i + a <= n:
				dp[i + a] = max(dp[i] + 1, dp[i + a])
			if i + b <= n:
				dp[i + b] = max(dp[i] + 1, dp[i + b])
			if i + c <= n:
				dp[i + c] = max(dp[i] + 1, dp[i + c])
	return dp[n] if dp[n] != -1 else 0

def min_cost(cost, m, n):
    R = len(cost)
    C = len(cost[0])
    tc = [[0 for _ in range(C)] for _ in range(R)]
    tc[0][0] = cost[0][0]
    for i in range(1, R):
        tc[i][0] = tc[i-1][0] + cost[i][0]
    for j in range(1, C):
        tc[0][j] = tc[0][j-1] + cost[0][j]
    for i in range(1, R):
        for j in range(1, C):
            tc[i][j] = min(tc[i-1][j-1], tc[i-1][j], tc[i][j-1]) + cost[i][j]
    return tc[m][n]

