MAX = 3000 

def smartNumber(n): 
	primes = [0] * MAX 
	result = [] 
	for i in range(2, MAX): 
		if primes[i] == 0: 
			primes[i] = 1 
			j = i * 2 
			while j < MAX: 
				primes[j] -= 1 
				if primes[j] == -3: 
					result.append(j) 
				j += i 
	result.sort() 
	return result[n - 1]

def amicable_numbers_sum(limit):
    if not isinstance(limit, int):
        return "Input is not an integer!"
    if limit < 1:
        return "Input must be bigger than 0!"

    def sum_of_divisors(n):
        return sum(fact for fact in range(1, n) if n % fact == 0)

    amicables = set()
    for num in range(2, limit + 1):
        sum_fact = sum_of_divisors(num)
        if sum_fact != num and sum_fact <= limit:
            if sum_of_divisors(sum_fact) == num:
                amicables.add(num)
                amicables.add(sum_fact)

    return sum(amicables)

def func(nums, k):
    import collections
    import heapq

    # Create a frequency dictionary
    freq_dict = collections.defaultdict(int)
    for row in nums:
        for num in row:
            freq_dict[num] += 1

    # Use a heap to keep track of the top k elements
    min_heap = []
    for num, freq in freq_dict.items():
        if len(min_heap) < k:
            heapq.heappush(min_heap, (freq, num))
        else:
            if freq > min_heap[0][0]:
                heapq.heappop(min_heap)
                heapq.heappush(min_heap, (freq, num))

    # Extract the elements from the heap and sort them by frequency and then by number in descending order
    result = heapq.nlargest(k, min_heap, key=lambda x: (x[0], x[1]))
    return [num for freq, num in result[::-1]]

