def merge(a, b):
    c = []
    i, j = 0, 0
    while i < len(a) and j < len(b):
        if a[i] < b[j]:
            c.append(a[i])
            i += 1
        else:
            c.append(b[j])
            j += 1
    c.extend(a[i:])
    c.extend(b[j:])
    return c

def merge_sort(x):
    if len(x) <= 1:
        return x
    middle = len(x) // 2
    left = merge_sort(x[:middle])
    right = merge_sort(x[middle:])
    return merge(left, right)

