import math

def divSum(n):
    result = 1
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            if i == (n // i):
                result += i
            else:
                result += (i + n // i)
    return result

def areEquivalent(num1, num2):
    return divSum(num1) == divSum(num2)

