def get_Position(a, n, m):
    for i in range(n):
        a[i] = (a[i] // m + (a[i] % m != 0))
    result, maxx = -1, -1
    for i in range(n - 1, -1, -1):
        if maxx < a[i]:
            maxx = a[i]
            result = i
    return result + 1

def max_sub_array_sum_repeated(a, n, k): 
    # Function to perform Kadane's algorithm
    def kadane(arr):
        max_so_far = -float('inf')
        max_ending_here = 0
        for x in arr:
            max_ending_here += x
            if max_ending_here > max_so_far:
                max_so_far = max_ending_here
            if max_ending_here < 0:
                max_ending_here = 0
        return max_so_far

    # Single array run for kadane
    max_kadane = kadane(a)

    if k == 1:
        return max_kadane

    # Calculate sum of complete array
    array_sum = sum(a)

    # Calculate prefix and suffix maximum sum
    prefix_sum = 0
    suffix_sum = 0
    max_prefix_sum = -float('inf')
    max_suffix_sum = -float('inf')

    for i in range(n):
        prefix_sum += a[i]
        max_prefix_sum = max(max_prefix_sum, prefix_sum)

    for i in range(n-1, -1, -1):
        suffix_sum += a[i]
        max_suffix_sum = max(max_suffix_sum, suffix_sum)

    # If sum is positive, return (max_prefix_sum + max_suffix_sum + (k-2)*array_sum)
    if array_sum > 0:
        return max(max_kadane, max_prefix_sum + max_suffix_sum + (k - 2) * array_sum)
    else:
        return max(max_kadane, max_prefix_sum + max_suffix_sum)

def flatten_list(list1):
    result_list = []
    if not list1:
        return result_list
    stack = [list(list1)]
    while stack:
        c_num = stack.pop()
        next = c_num.pop()
        if c_num:
            stack.append(c_num)
        if isinstance(next, list):
            if next:
                stack.append(list(next))
        else:
            result_list.append(next)
    result_list.reverse()
    return result_list

def max_sum_increasing_subseq(a, n, index, k):
    dp = [0] * n
    dp[0] = a[0]
    for i in range(1, n):
        for j in range(i):
            if a[i] > a[j]:
                dp[i] = max(dp[i], dp[j] + a[i])
    result = 0
    for i in range(index + 1):
        if a[i] < a[k]:
            result = max(result, dp[i] + a[k])
    return result

def find_Max_Len_Even(str): 
    n = len(str) 
    i = 0
    currlen = 0
    maxlen = 0
    st = -1
    while (i < n): 
        if (str[i] == ' '): 
            if (currlen % 2 == 0): 
                if (maxlen < currlen): 
                    maxlen = currlen 
                    st = i - currlen 
            currlen = 0 
        else: 
            currlen += 1
        i += 1
    if (currlen % 2 == 0): 
        if (maxlen < currlen): 
            maxlen = currlen 
            st = i - currlen 
    if (st == -1): 
        return "-1" 
    return str[st: st + maxlen]

