from heapq import heappop, heappush

class Node:
    def __init__(self, value, list_num, index):
        self.value = value
        self.list_num = list_num
        self.index = index

    def __lt__(self, other):
        return self.value < other.value

def find_minimum_range(list):
    high = float('-inf')
    p = (0, float('inf'))
    pq = []

    for i in range(len(list)):
        heappush(pq, Node(list[i][0], i, 0))
        high = max(high, list[i][0])

    while True:
        top = heappop(pq)
        low = top.value
        i = top.list_num
        j = top.index

        if high - low < p[1] - p[0]:
            p = (low, high)

        if j == len(list[i]) - 1:
            return p

        heappush(pq, Node(list[i][j + 1], i, j + 1))
        high = max(high, list[i][j + 1])

def minimum_Length(s):
    maxOcc = 0
    n = len(s)
    count = [0]*26
    for char in s:
        count[ord(char) - ord('a')] += 1
    for i in range(26):
        if count[i] > maxOcc:
            maxOcc = count[i]
    return n - maxOcc

def Check_Solution(a, b, c):
    discriminant = b * b - 4 * a * c
    if discriminant < 0:
        return "No"

    sqrt_discriminant = discriminant ** 0.5
    root1 = (-b + sqrt_discriminant) / (2 * a)
    root2 = (-b - sqrt_discriminant) / (2 * a)

    if root1 == 2 * root2 or root2 == 2 * root1:
        return "Yes"
    else:
        return "No"

def permute_string(s):
    if len(s) == 0:
        return ['']
    prev_list = permute_string(s[1:])
    next_list = []
    for i in range(len(prev_list)):
        for j in range(len(s)):
            new_str = prev_list[i][:j] + s[0] + prev_list[i][j:]
            next_list.append(new_str)
    return next_list

