def lbs(arr):
    n = len(arr)

    # Step 1: Create LIS array
    lis = [1] * n
    for i in range(1, n):
        for j in range(0, i):
            if arr[i] > arr[j] and lis[i] < lis[j] + 1:
                lis[i] = lis[j] + 1

    # Step 2: Create LDS array
    lds = [1] * n
    for i in reversed(range(n - 1)):
        for j in reversed(range(i, n)):
            if arr[i] > arr[j] and lds[i] < lds[j] + 1:
                lds[i] = lds[j] + 1

    # Step 3: Find maximum of (lis[i] + lds[i] - 1)
    maximum = 0
    for i in range(n):
        maximum = max(maximum, lis[i] + lds[i] - 1)

    return maximum

def get_pairs_count(arr, n, sum_val):
    count = 0
    freq = {}

    for i in range(n):
        complement = sum_val - arr[i]
        if complement in freq:
            count += freq[complement]

        if arr[i] in freq:
            freq[arr[i]] += 1
        else:
            freq[arr[i]] = 1

    return count

