def check(arr, n):
    if n <= 1:
        return True

    sorted_arr = sorted(arr)
    left, right = 0, n - 1
    i, j = 0, n - 1

    while i <= j:
        if arr[left] == sorted_arr[i]:
            left += 1
            i += 1
        elif arr[right] == sorted_arr[i]:
            right -= 1
            i += 1
        elif arr[left] == sorted_arr[j]:
            left += 1
            j -= 1
        elif arr[right] == sorted_arr[j]:
            right -= 1
            j -= 1
        else:
            return False

    return True

